Figure 2 | Maps showing significance levels resulting from of a randomization test in Australian 

Acacia
.


White cells contain no records; beige cells are not significant. (
a
) PD: the red values indicate grid cells that contain significantly less PD than expected; the blue values indicate grid cells that contain significantly more PD than expected. (
b
) RPD: the red values indicate grid cells that contain significantly less RPD than expected; the species present in that cell are significantly more closely related than expected. The blue values indicate grid cells that contain significantly more RPD than expected; the species present in that cell are significantly more distantly related than expected. (
c
) Phylogenetic endemism (PE). The red values indicate grid cells that contain significantly less PE than expected; the blue values indicate grid cells that contain significantly more PE than expected. (
d
) Relative phylogenetic endemism (RPE). The red values indicate grid cells that contain significantly lower RPE than expected; the blue values indicate grid cells that contain significantly higher RPE than expected.

